//<![CDATA[

var geocoder = new google.maps.Geocoder();
				var town_postcode_text;

				var str_update_field = 'found_town_update'; //not used in post back - only for display

				function update_geocode_values(){
				  //clear any "cached" searches
				  //without lat/long, if the address has not changed, when the search is submitted it comes from session vars
				  $('search_origin_address_lat').value = '';
				  $('search_origin_address_long').value = '';

				  $(str_update_field).innerHTML = 'Loading...';

				  var address = $('search_origin_address').value;
				  if (!address.blank()) {
					geocoder.geocode({
					  'address': address
					}, function(results, status){

					  if (results && results[0]) {
						var loc = results[0].geometry.location; //no interface to select which ones, so just take the first for now

						$('search_origin_address_lat').value = loc.lat();
						$('search_origin_address_long').value = loc.lng();
						
						$(str_update_field).innerHTML = results[0].formatted_address;
						
						update_static_map();
					  }else{
						$(str_update_field).innerHTML = town_postcode_text;
					  }
					});

				  }else{
					$(str_update_field).innerHTML = town_postcode_text;
				  }
				}

				document.observe("dom:loaded", function() {
				  try {
					town_postcode_text = $(str_update_field).innerHTML; //used to set the text back once the text field is cleared
					Event.observe('search_origin_address', 'keyup', update_geocode_values);
				  } catch (e) {
					if (e instanceof TypeError) {
					  if (!$('search_origin_address') || !$(str_update_field)) {
						console.error('Both "search_origin_address" and "found_town_update" need to be defined on this form for client side geocoding');
					  }
					}
					console.error(e);
				  }
				  if (!$('search_origin_address_lat') || !$('search_origin_address_long')) {
					//these are the two fields sent to the search model! make sure they are being posted back
					console.error('Text fields: search_origin_address_lat, search_origin_address_long are required for client side geocoding!!');
				  }
				});
				
